    [],nt"revision_timestamp": "2016-07-27T23:03:43.060104",nt"name": "hydrogeomorphic-evaluation-of-ecosystem-restoration-and-management-options-for-cape-romain",nt"isopen":
    false,nt"url": null,nt"notes": "This report provides a hydrogeomorphic
    (HGM) evaluationof ecosystem restoration and management options for CapeRomain National
    Wildlife Refuge (CRNWR) including therecent boundary expansion encompassing Jeremy
    Island andthe mainland White and King tracts. CRNWR encompasses66,287 acres and
    spans 22 miles of the South Carolina coast,and it protects critically important
    estuarine and islandhabitats used by diverse animal communities including manyspecies
    of concern birds, turtles, marine fisheries and shellfish,and mammals. CRNWR contains
    29,000 acres of Class IWilderness Area and is recognized as one of only five NWRsincluded
    in the UNESCO Biosphere Reserve Program. Despiteits exceptional resources, the refuge
    has been influenced bymany on-and off-site developments that have degraded orreduced
    valuable habitats such as the diversion and reductionof freshwater and sediment
    inputs to the regional coast, bays,and islands; construction of the Atlantic Intracoastal
    Waterway(AIWW); coastal and bay development and contamination; andsea level rise.
    Specific recommendations to address and support restoration and management goals
    are provided in this report.",nt"license_title": "License Not Specified",nt"extras":
